slider=(()=>{let e="",t=document.getElementById("atm-sliderTutorial"),d=t.getElementsByClassName("atm-slideTuto"),l=70*parseInt(d.length),a=t.getElementsByClassName("atm-wrappSlider");a[0].style.width=l+"vw";for(let t=0;t<d.length;t++)e=e+'<div data-id="atmSlideTo'+t+'"></div>';let i=document.createElement("div");i.innerHTML=e,i.classList.add("atm-dotsSlider"),t.appendChild(i)}),window.onload=(()=>{slider()});